import React,{Component} from "react";

import Header from './component/Header';
import NewFilm from './component/NewFilm';
class App extends Component {
  render() {
    return (
      <div >
      <Header/>
      <NewFilm price={1}>hello</NewFilm>
      </div>      
    )   
  }
}
export default App;
